import * as React from 'react';
import { View, Text ,StyleSheet} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import Home from './components/Home';
import SignUp from './components/signUp';
import SignIn from './components/signIn';
import ProductInfo from './components/ProductInfo';
import PopularProduct from './components/PopularProduct';

const Stack = createNativeStackNavigator();


export default function App() {

return (
  <NavigationContainer>
  <Stack.Navigator >
    <Stack.Screen options={{title:'Sign Up'}} name="SignUp" component={SignUp} />
    <Stack.Screen options={{title:'Sign In'}} name="SignIn" component={SignIn} />
    <Stack.Screen options={{title:'Home'}} name="Home" component={Home} />
    <Stack.Screen options={{title:'Product Info'}} name="ProductInfo" component={ProductInfo} />

  </Stack.Navigator>
</NavigationContainer>

  );
}
